import Navbar from "./navbar";
import Head from "next/head";

const layout = props => (
  <div>
    <Head>
      <link
        rel="stylesheet"
        href="https://stackpath.bootstrapcdn.com/bootstrap/4.4.1/css/bootstrap.min.css"
      />
    </Head>
    <Navbar />
    {props.children}
  </div>
);
export default layout;
